用途：<br>
成分：化学合成油<br>
特に高温・高負荷条件下における、連続長時間使用を可能にすべく開発されたMoty'sレーシングオイルの最高峰の製品です。極限状態におけるクランクジャーナルベアリングや、クランクピン等、最も困難な部分の油膜保持を可能としました。粘度温度特性に優れたハイドロカーボン系合成基油と耐熱・吸着性に優れたエステル系合成基油を主たる構成とした、ノンポリマータイプの製品となっています。各種機能添加剤についても他に例を見ない程の、正に"ゼロからの開発"と呼ぶにふさわしい各基材の選定及び分子量分布となっています。<br>
